import React from 'react';
import Card from './Card';
import Dark from './Dark.jpg';
import exc from './exc.jpg';
import Stranger from './Stranger-things.jpg';
import punisher from './punisher.jpg';
import ghoul from './ghoul.jpg';
import data from './data';
function Cardsbox()
{
    return(
        <section className="cards-section">
            <div className="container">
              <Card imgSrc={Dark} title={data[0].title} link="https://www.netflix.com/in/title/80100172"/>
              <Card imgSrc={exc} title={data[1].title} link="https://www.netflix.com/in/title/80990668"/>
              <Card imgSrc={Stranger} title={data[2].title} link="https://www.netflix.com/in/title/80057281"/>
              <Card imgSrc={punisher} title={data[3].title} link="https://www.netflix.com/in/title/80117498"/>
              <Card imgSrc={ghoul} title={data[4]} link="https://www.netflix.com/in/title/80245450"/>
            </div>
        </section>
    );
}

export default Cardsbox;
